(203, 'es', 'default', 'affiliate_pending_message', '<span class=\"alert-heading\" style=\"font-size: 15px; font-weight: 600\">¡Tu cuenta está inactiva actualmente!</span><br>\nDebe esperar hasta que el propietario de la tienda active su cuenta. El cambio de estado le será informado por correo electrónico.', '2021-10-18 02:27:55', '2021-10-18 02:27:55'),
(204, 'zh', 'default', 'affiliate_pending_message', '<span class=\"alert-heading\" style=\"font-size: 15px; font-weight: 600\">您的帐户目前处于非活动状态！</span><br>\n您必须等到店主激活您的帐户。状态更改将通过电子邮件通知您。', '2021-10-18 02:27:55', '2021-10-18 02:27:55'),
(205, 'de', 'default', 'affiliate_pending_message', '<span class=\"alert-heading\" style=\"font-size: 15px; font-weight: 600\">Ihr Konto ist derzeit inaktiv!</span><br>\nSie müssen warten, bis der Inhaber des Shops Ihr Konto aktiviert. Die Statusänderung wird Ihnen per E-Mail mitgeteilt.', '2021-10-18 02:27:55', '2021-10-18 02:27:55'),
(206, 'fr', 'default', 'affiliate_pending_message', '<span class=\"alert-heading\" style=\"font-size: 15px; font-weight: 600\">Votre compte est actuellement inactif !</span><br>\nVous devez attendre que le propriétaire de la boutique active votre compte. Le changement de statut vous sera notifié par e-mail.', '2021-10-18 02:27:56', '2021-10-18 02:27:56'),
(207, 'pt', 'default', 'affiliate_pending_message', '<span class=\"alert-heading\" style=\"font-size: 15px; font-weight: 600\">Sua conta está inativa no momento!</span><br>\nVocê deve esperar até que o dono da loja ative sua conta. A mudança de status será informada a você por e-mail.', '2021-10-18 02:27:56', '2021-10-18 02:27:56'),
