(239, 'es', 'default', 'welcome_text_in_dashboard', 'Este es su panel de control principal. Para promocionar la tienda, utilice el enlace de afiliado a continuación (o cupones). Cualquiera que haga una compra utilizando su enlace (o cupones) lo ayudará a ganar la recompensa que se muestra a la derecha.', '2021-10-18 02:28:05', '2021-10-18 02:28:05'),
(240, 'zh', 'default', 'welcome_text_in_dashboard', '这是您的主要仪表板。要宣传商店，请使用下面的附属链接（或优惠券）。任何人使用您的链接（或优惠券）进行购买都将帮助您获得右侧所示的奖励。', '2021-10-18 02:28:05', '2021-10-18 02:28:05'),
(241, 'de', 'default', 'welcome_text_in_dashboard', 'Dies ist Ihr primäres Dashboard. Um für den Shop zu werben, verwenden Sie bitte den untenstehenden Affiliate-Link (oder Coupons). Jeder, der einen Kauf über Ihren Link (oder Ihre Coupons) tätigt, hilft Ihnen dabei, die rechts angezeigte Prämie zu verdienen.', '2021-10-18 02:28:05', '2021-10-18 02:28:05'),
(242, 'fr', 'default', 'welcome_text_in_dashboard', 'Il s\'agit de votre tableau de bord principal. Pour promouvoir le magasin, veuillez utiliser le lien d\'affiliation ci-dessous (ou des coupons). Quiconque effectue un achat en utilisant votre lien (ou vos coupons) vous aidera à gagner la récompense indiquée à droite.', '2021-10-18 02:28:06', '2021-10-18 02:28:06'),
(243, 'pt', 'default', 'welcome_text_in_dashboard', 'Este é o seu painel principal. Para promover a loja, use o link de afiliado abaixo (ou cupons). Qualquer pessoa que fizer uma compra usando o seu link (ou cupons) irá ajudá-lo a ganhar a recompensa mostrada à direita.', '2021-10-18 02:28:06', '2021-10-18 02:28:06'),
(244, 'it', 'default', 'welcome_text_in_dashboard', 'Questa è la tua dashboard principale. Per promuovere il negozio, utilizza il link di affiliazione di seguito (o i coupon). Chiunque effettui un acquisto utilizzando il tuo link (o coupon) ti aiuterà a guadagnare il premio mostrato a destra.', '2021-10-18 02:28:06', '2021-10-18 02:28:06'),
