(1533, 'en', 'default', 'account_not_active', '<span class=\"alert-heading\" style=\"font-size: 15px; font-weight: 600\">Your account is not active!</span> <br>You have to wait until the owner of the shop activates your account. We will notify you by sending an email about the status change.', '2021-10-21 21:15:14', '2021-10-21 21:15:14'),
(1534, 'es', 'default', 'account_not_active', '<span class=\"alert-heading\" style=\"font-size: 15px; font-weight: 600\">¡Tu cuenta no está activa!</span> <br> Tienes que esperar hasta que el propietario de la tienda active tu cuenta. Le notificaremos enviándole un correo electrónico sobre el cambio de estado.', '2021-10-21 21:18:49', '2021-10-21 21:18:49'),
