(1536, 'de', 'default', 'account_not_active', '<span class=\"alert-heading\" style=\"font-size: 15px; font-weight: 600\">Ihr Konto ist nicht aktiv! </span> <br>Sie müssen warten, bis der Inhaber des Shops Ihr Konto aktiviert. Wir benachrichtigen Sie per E-Mail über die Statusänderung.', '2021-10-21 21:22:01', '2021-10-21 21:22:01'),
(1537, 'fr', 'default', 'account_not_active', '<span class=\"alert-heading\" style=\"font-size: 15px; font-weight: 600\">Votre compte n\'est pas actif !</span> <br> Vous devez attendre que le propriétaire de la boutique active votre compte. Nous vous informerons en envoyant un e-mail du changement de statut.', '2021-10-21 21:23:22', '2021-10-21 21:23:22'),
(1538, 'pt', 'default', 'account_not_active', '<span class=\"alert-heading\" style=\"font-size: 15px; font-weight: 600\">Sua conta não está ativa!</span> <br> Você tem que esperar até que o dono da loja ative sua conta. Iremos notificá-lo enviando um e-mail sobre a mudança de status.', '2021-10-21 21:24:35', '2021-10-21 21:24:35'),
